import React from 'react';
import Pation from './Pation';
import Apointment from './Appointment';
import Drug from './Drug';


function Navbar() {
  return (
<div className="photo">
<nav>
<ul>
     <li><a href="#">patient</a></li>
     <li><a href="#">home</a></li>
     <li><a href="#">appointement</a></li>
     <li><a href="#">drug</a></li>


</ul>
</nav>
</div>
  );
}

export default Navbar;
